import React from 'react'


export default class Radiobuttons extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            checked: 'false'
        }
    }



    render() {
        return (
            <div>
                <form>
                    {<input type="radio" />}
                    <label>First</label><br></br>
                    {<input type="radio" />}
                    <label>Second</label><br></br>
                    {<input type="radio" onChange={this.props.onChange} />}
                    <label>Third</label><br></br>
                </form>
            </div>
        )
    }
}
